import React from 'react';
import ReactDOM from 'react-dom';
import ArticleHeader from './components/ArticleHeader/index.js';

const articleHeader = {
  data: {
    category: 'Fixed-income Insights',
    categoryUrl: undefined,
    title: 'Designating a Trust as an IRA Beneficiary',
    date: 'May 15, 2019',
    timeToRead: '5',
    description:
      'Such a strategy can be beneficial, but be sure to consult and experienced attorney and tax professional to navigate the maze of rules'
  },
  error: {
    message: undefined,
    code: undefined
  },
  warning: {
    warningMessage: undefined
  }
};


ReactDOM.render(<ArticleHeader  {...articleHeader} />, document.getElementById('root'));
